import HeaderInAdminPage from "./headers/HeaderInAdminPage";
import HeaderInAuthorizedEmpPage from "./headers/HeaderInAuthorizedEmpPage";
function App() {
  return (
    <div className="App">

        <GeneralRouter/>
        <HeaderCommon/>
        <HeaderInAdminPage/>
        <HeaderInAuthorizedEmpPage/>

    </div>
  );
}

export default App;
